import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/twocolumnswithdescription", {
  title: __("Two Columns With Description", "GB"),
  icon: <img src="data:image/png;base64," />,
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },    
    contentUB: { type: "string", default: `Frequently asked questions` },
    contentUA: {
      type: "string",
      default: `Ac euismod vel sit maecenas id pellentesque eu sed consectetur. Malesuada adipiscing sagittis vel nulla nec. Urna, sed a lectus elementum blandit et.`,
    },
    contentt: {
      type: "string",
      default: `What&#039;s the best thing about Switzerland?`,
    },
    contentUC: {
      type: "string",
      default: `I don&#039;t know, but the flag is a big plus. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div className="bg-white">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <div className="max-w-2xl lg:mx-auto lg:text-center">
            
            <h2 className="text-3xl font-extrabold tracking-tight text-gray-900 sm:text-4xl">
              <RichText
                value={attributes.contentUB}
                default={"Frequently asked questions"}
                onChange={(newtext) => setAttributes({ contentUB: newtext })}
              />
            </h2>
            <p className="mt-4 text-gray-500">
              <RichText
                value={attributes.contentUA}
                default={
                  "Ac euismod vel sit maecenas id pellentesque eu sed consectetur. Malesuada adipiscing sagittis vel nulla nec. Urna, sed a lectus elementum blandit et."
                }
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </p>
          </div>
          <div className="mt-20">
            
            <dl className="space-y-10 lg:space-y-0 lg:grid lg:grid-cols-2 lg:gap-x-8 lg:gap-y-10">
              {arData.map((v) => {
                return (
                  <div>
                    <dt className="font-semibold text-gray-900">
                      {v.question}
                    </dt>
                    <dd className="mt-3 text-gray-500">
                      {v.answer}
                    </dd>
                  </div>
                )
              })}
            </dl>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <div class="max-w-2xl lg:mx-auto lg:text-center">
            
            <h2 class="text-3xl font-extrabold tracking-tight text-gray-900 sm:text-4xl">
             <RichText.Content value={attributes.contentUB}/>
            </h2>
            <p class="mt-4 text-gray-500">{attributes.contentUA} </p>
          </div>
          <div class="mt-20">
            
            <dl class="space-y-10 lg:space-y-0 lg:grid lg:grid-cols-2 lg:gap-x-8 lg:gap-y-10">
                
              {arData.map((v) => {
                  return (
                    <div>
                      <dt className="font-semibold text-gray-900">
                        {v.question}
                      </dt>
                      <dd className="mt-3 text-gray-500">
                        {v.answer}
                      </dd>
                    </div>
                  )
                })}
            </dl>
          </div>
        </div>
      </div>
    );
  },
});
